import { Component, OnInit } from '@angular/core';

import { HttpClient, HttpHeaders } from '@angular/common/http';
import { ActivatedRoute } from '@angular/router';
import { Router, RouterModule } from '@angular/router';
import * as pdfmake from 'pdfmake/build/pdfmake';
import pdfFonts from "pdfmake/build/vfs_fonts";
import Swal from'sweetalert2'

@Component({
  selector: 'app-ficha-ind',
  templateUrl: './ficha-ind.component.html',
  styleUrls: ['./ficha-ind.component.scss']
})
export class FichaIndComponent implements OnInit {

	logo = "data:image/png;base64,";
	imagen_footer = "data:image/png;base64,";

	idOT: any;
	dataOT$: any = [];

	ActividadeOT$: any = [];

	doc: any;
	dato = {
		estado: ''
	}

  	dataOrden: any = [];
  	dataActividad: any = [];
  	codtable:any = [];

  	constructor(private activatedRoute: ActivatedRoute, private router: Router, private http:HttpClient) {
  		this.idOT = this.activatedRoute.snapshot.paramMap.get('id');
  	}

  	ngOnInit() {
  		this.getData();
  	}

  	getData(){
  		this.http.get('http://localhost:4000/orden-trabajo/join/cliente/select/'+this.idOT).subscribe(
  			(resp) => {
  				this.dataOT$ = resp as []
  				for(let ot of this.dataOT$.data){
  					this.dataOrden.push({'id': ot.idOT, 'cliente':ot.cliente, 'moto':ot.motocicleta, 'tipo':ot.tipo, 'fecha_llegada':ot.fecha_llegada, 'fecha_entrega':ot.fecha_entrega, 'estado':ot.estado, 'nombre': ot.nombre, 'apellido_p':ot.apellido_p, 'apellido_m':ot.apellido_m, 'dir_comuna':ot.dir_comuna, 'rut':ot.rut, 'email':ot.email, 'celular':ot.celular});
  				}
  			}
  		);
  		this.http.get('http://localhost:4000/act_OT/select/orden-trabajo/'+this.idOT).subscribe(
      		(resp) => {
        		this.ActividadeOT$ = resp as []
        		for(let ot of this.ActividadeOT$.data){
            		this.dataActividad.push({'id': ot.ordenTrabajo, 'actividad':ot.actividad, 'tiempo_estimado':ot.tiempo_estimado, 'estado':ot.estado, 'fecha_inicio':ot.fecha_inicio, 'fecha_finalizado':ot.fecha_finalizado});
      			}
      		}
      	);
  	}

  	Finalizado(){
  		this.dato= {
  			'estado': 'Finalizado'
  		};
  		this.http.put('http://localhost:4000/orden-trabajo/estado/update/'+this.idOT, this.dato, {responseType: 'text'}).subscribe(
  			response =>  Swal.fire({
  				icon: 'success',
  				title: 'El trabajo ha sido entregado y finalizado!',
  				confirmButtonText: 'Ok!'
  				}).then((result) => {
  					if (result.value) {
  						this.ngOnInit();
  					}
  				}) ,
			err => Swal.fire({
  				icon: 'error',
  				title: 'Ha ocurrido un error, vuelva a intentarlo'
  			})
		);	
  	}

  	gotoDetailsAct(idRelacion: any) {
    	this.router.navigate(['/actividad-detalle/', idRelacion]);
  	}

  	Estado(idRelacion: any, estadoAct: any) {
  		this.dato= {
  			'estado': estadoAct
  		};
  		this.http.put('http://localhost:4000/estado-actividad/'+idRelacion, this.dato, {responseType: 'text'}).subscribe(
  			(response) => {
  				console.log('response from post data is ', response);
  			},(error)=>{
  				console.log('error during post is ', error)
  			});
  		this.ngOnInit();
  	}

  	generateReport(){
  		var content = [];
      	this.codtable = [];
      	pdfmake.vfs = pdfFonts.pdfMake.vfs;
      	content.push({text: 'OT'+this.dataOrden[0].id+'C'+this.dataOrden[0].cliente, style: 'watermark'});
      	content.push({text: 'Ficha de Trabajo', style: 'header'});
      	content.push({columns: [{image: this.logo, width: 60, absolutePosition: {x: 60, y: 40}}]});
      	content.push({text: '\n\n'});
      	content.push({text:'Datos de Orden de Trabajo\n\n', style:'subheader'});
      	content.push({
  		columns: [{
  			type: 'none',
  			ul: [{
  				style:'paragraphBold', text:['Nombre Cliente: ',{text:this.dataOrden[0].nombre+' '+this.dataOrden[0].apellido_p+' '+this.dataOrden[0].apellido_m, style:'paragraph'}]},
             	{style:'paragraphBold', text:['Comuna: ',{text:this.dataOrden[0].dir_comuna+'\n', style:'paragraph'}]},
             	{style:'paragraphBold', text:['Celular de contacto: ',{text:this.dataOrden[0].celular+'\n', style:'paragraph'}]},
             	{style:'paragraphBold', text:['Email de contacto: ',{text:this.dataOrden[0].email+'\n', style:'paragraph'}]},
             	]
             },{
           	type: 'none',
  			ul: [
             	{style:'paragraphBold', text:['Producto: ',{text:this.dataOrden[0].tipo+'\n', style:'paragraph'}]},
             	{style:'paragraphBold', text:['Motocicleta: ',{text:this.dataOrden[0].moto+'\n', style:'paragraph'}]},
             	{style:'paragraphBold', text:['Fecha de ingreso: ',{text:this.dataOrden[0].fecha_llegada+'\n', style:'paragraph'}]},
             	{style:'paragraphBold', text:['Fecha de entrega: ',{text:this.dataOrden[0].fecha_entrega+'\n', style:'paragraph'}]},
  				]
  			}]
  		});
  		content.push({text:'\n\n\n'});
  		this.codtable.push([{text:'N°', style:'paragraphBold'},{text:'Actividad', style:'paragraphBold'},{text:'Fecha Inicio', style:'paragraphBold'},{text:'Estado', style:'paragraphBold'},{text:'Observaciones', style:'paragraphBold'}]);
		var i=1;
      	for(let act of this.dataActividad){
        	if(act.estado != 'No aplica' && act.estado != 'Aplica'){
          		this.codtable.push([{text:i, style:'paragraph'},{text:act.actividad, style:'paragraph'},{text:act.fecha_inicio, style:'paragraph'},{text:act.estado, style:'paragraph'},{text:'', style:'paragraph'}]);
         		 i++;
        	}else if(act.estado == 'Aplica'){
          		this.codtable.push([{text:i, style:'paragraph'},{text:act.actividad, style:'paragraph'},{text:act.fecha_inicio, style:'paragraph'},{text:'', style:'paragraph'},{text:'', style:'paragraph'}]);
          		i++;
        	}
      	}
      	content.push({
        	alignment: 'center', columns: [{ style: 'tableExampledata',
          	table: {
            	heights: 20,
            	widths: [15, 150,'auto', 'auto', 180],
            	body: this.codtable
          	}
        	}]
      	});

      	var docDefinition = {
        	info: {
          		title: 'Ficha de Trabajo-'+'OT'+this.dataOrden[0].id+'C'+this.dataOrden[0].cliente
        	},
        	pageSize: 'LETTER',
        	pageMargins: [ 60, 60, 80, 80 ],
        	footer: {
        		columns: [{
        	    image: this.imagen_footer,
        	    width:612
        	  }]
        	},
        	content : content,
        	styles: {
          		watermark: {
            		fontSize: 10,
            		alignment: 'right',
            		bold: false,
            		opacity: .2,
            		margin: [0, 0, 0, 0],
            		fontFamily: '"Times New Roman", Times, serif'
          		},
          		header: {
          			fontSize: 14,
          			alignment: 'center',
          			bold: true,
          			fontFamily: '"Times New Roman", Times, serif'
          		},
          		subheader: {
          			fontSize: 12,
          			alignment: 'justify',
          			bold: true,
          			fontFamily: '"Times New Roman", Times, serif'
          		},
          		paragraph:{
          		  	fontSize:10,
          		  	bold: false,
          		  	alignment: 'justify',
          		  	fontFamily: '"Times New Roman", Times, serif'
          		},
          		paragraphCenter:{
          		  	fontSize:10,
          		  	bold: false,
          		  	alignment: 'center',
          		  	fontFamily: '"Times New Roman", Times, serif'
          		},
          		paragraphBoldCenter:{
          		  	fontSize:10,
          		  	bold:true,
          		  	alignment: 'center',
          		  	fontFamily: '"Times New Roman", Times, serif'
          		},
          		paragraphBold:{
          		  	fontSize:10,
          		  	bold:true,
          		  	alignment: 'justify',
          		  	fontFamily: '"Times New Roman", Times, serif'
          		},
          		columns: {
          			columnGap: 20
        		},
        		tableExampledata:{
        			fontSize:10,
        		  	alignment: 'justify',
        		  	fontFamily: '"Times New Roman", Times, serif',
          		 	width: 300
         		}
        	}
      	};
      	this.doc = pdfmake.createPdf(docDefinition).download('Ficha de Trabajo-'+'OT'+this.dataOrden[0].id+'C'+this.dataOrden[0].cliente+'.pdf');
  	}
}
